import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { LogOut, reset } from "../features/authSlice";
import { Container, Navbar, Nav, NavDropdown } from "react-bootstrap";
import logo from "../bps.png";

const NavB = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { user } = useSelector((state) => state.auth);

  const logout = () => {
    dispatch(LogOut());
    dispatch(reset());
    navigate("/");
  };

  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
        <Navbar.Brand>
          <img alt="logo bps palu" src={logo} style={{ width: "250px" }} />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav" className="">
          <Nav className="me-auto"></Nav>
          <Nav>
            <Link to={"/dashboard"} className="nav-link" style={{ textDecoration: "none" }}>
              Dashboard
            </Link>
            {user && user.role === "admin" && (
              <Nav>
                <Link to={"/users"} className="nav-link" style={{ textDecoration: "none" }}>
                  Pegawai
                </Link>
              </Nav>
            )}
            <Link to={"/izin"} className="nav-link" style={{ textDecoration: "none" }}>
              Izin
            </Link>
            <NavDropdown title={`${user && user.name} (${user && user.role})`} id="collasible-nav-dropdown">
              <NavDropdown.Item onClick={logout}>Logout</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavB;
